import React from 'react';
import '../style/cakes.css';
import { Link } from 'react-router-dom';

// You would replace these with your actual image imports
import cakeImage1 from '../images/strawberry.jpeg';
import cakeImage2 from '../images/vanilla.jpeg';
import cakeImage3 from '../images/rainbow.jpeg';
import cakeImage4 from '../images/cheese.jpeg';
import cakeImage5 from '../images/pineapple.jpeg';
import cakeImage6 from '../images/fruit.jpeg';
import cakeImage7 from '../images/wedding1.jpeg';
import cakeImage8 from '../images/wedding2.jpeg';
import cakeImage9 from '../images/wedding3.jpeg';
import cakeImage10 from '../images/wedding4.jpeg';
import cakeImage11 from '../images/wedding5.jpeg';
import cakeImage12 from '../images/wedding6.jpeg';
import cakeImage13 from '../images/tall1.jpeg';
import cakeImage14 from '../images/tall2.jpeg';
import cakeImage15 from '../images/tall3.jpeg';
import cakeImage16 from '../images/tall4.jpeg';
import cakeImage17 from '../images/tall5.jpeg';
import cakeImage18 from '../images/tall6.jpeg';
import cakeImage19 from '../images/cake7.jpeg';
import cakeImage20 from '../images/cake8.jpeg';
import cakeImage21 from '../images/wedding7.jpeg';
import cakeImage22 from '../images/wedding8.jpeg';
import cakeImage23 from '../images/tall7.jpeg';
import cakeImage24 from '../images/tall8.jpeg';








const CakeModal = ({ cake, onClose }) => (
    <div className="modal-overlay" onClick={onClose}>
        <div className="modal-content" onClick={e => e.stopPropagation()}>
            <h2>{cake.name}</h2>
            <img src={cake.image} alt={cake.name} className="modal-image" />
            <p>{cake.description}</p>
            <p className="modal-price">Price: Rs {cake.price} per pound</p>
            <button onClick={onClose}>Close</button>
        </div>
    </div>
);

const CakeCard = ({ cake, onClickCake }) => (
    <div className="cake-card">
        <div className="clickable" onClick={() => onClickCake(cake)}>
            <img src={cake.image} alt={cake.name} className="cake-image" />
            <h3>{cake.name}</h3>
        </div>
        <p className="price-info">Per pound <span className="price">Rs {cake.price}</span></p>
        <div className="button-group">
            <button className="add-to-cart">Add to cart</button>
            <button className="buy-now">Buy Now</button>
        </div>
    </div>
);

const CakeSection = ({ title, cakes, onClickCake }) => (
    <div className="cake-section">
        <h2>{title}</h2>
        <div className="cake-grid">
            {cakes.map((cake, index) => (
                <CakeCard key={index} cake={cake} onClickCake={onClickCake} />
            ))}
        </div>
    </div>
);

const Cakes = () => {
    const [selectedCake, setSelectedCake] = useState(null);

   
        const tallCakes = [
            { image: cakeImage1, name: "Strawberry", price: "1045" },
            { image: cakeImage2, name: "Vanilla", price: "1045" },
            { image: cakeImage3, name: "Rainbow", price: "1045" },
            { image: cakeImage4, name: "Cheese", price: "1045" },
            { image: cakeImage5, name: "Pineapple", price: "1045" },
            { image: cakeImage6, name: "Fruit", price: "1045" },
            { image: cakeImage19, name: "Fruit", price: "1045" },
            { image: cakeImage20, name: "Fruit", price: "1045" },

        ];

        const weddingCakes = [
            { image: cakeImage7, name: "Purple Cake", price: "1045" },
            { image: cakeImage8, name: "Purple Cake", price: "1045" },
            { image: cakeImage9, name: "Purple Cake", price: "1045" },
            { image: cakeImage10, name: "Purple Cake", price: "1045" },
            { image: cakeImage11, name: "Purple Cake", price: "1045" },
            { image: cakeImage12, name: "Purple Cake", price: "1045" },
            { image: cakeImage21, name: "Fruit", price: "1045" },
            { image: cakeImage22, name: "Fruit", price: "1045" },

        ];

        const anniversaryCakes = [
            { image: cakeImage13, name: "Purple Cake", price: "1045" },
            { image: cakeImage14, name: "Purple Cake", price: "1045" },
            { image: cakeImage15, name: "Purple Cake", price: "1045" },
            { image: cakeImage16, name: "Purple Cake", price: "1045" },
            { image: cakeImage17, name: "Purple Cake", price: "1045" },
            { image: cakeImage18, name: "Purple Cake", price: "1045" },
            { image: cakeImage23, name: "Fruit", price: "1045" },
            { image: cakeImage24, name: "Fruit", price: "1045" },
        ];
        const handleClickCake = (cake) => {
            setSelectedCake(cake);
          };

        return (
            <div className="cakes-catalog">
                <CakeSection title="Tall Cakes" cakes={tallCakes} />
                <CakeSection title="Wedding Cakes" cakes={weddingCakes} />
                <CakeSection title="Anniversary Cakes" cakes={anniversaryCakes} />
            </div>
        );
    };

    export default Cakes;
